import React from "react";

const Loading = (props) => {
    return (
        <>
            <h5>Currently writing books...</h5>
            <img src="https://i.pinimg.com/originals/f6/06/cb/f606cbf26c0a18898b96ef6857953a75.gif" alt="Book loading gif" />
        </>
    )
}

export default Loading;
